import React, { Component } from 'react';

const ImageView  = ({src}) =>{
    const styleDiv = {
        width:'700px',
        height:'500px',
        zIndex:'10',
        backgroundColor:'white'
    }
    return (
        <div style={styleDiv}>
            <img src={src} />
        </div>
    )
}

export default ImageView;
